import React from 'react';
import spinner from './spinner.gif';
import ClimbingBoxLoader from "react-spinners/ClimbingBoxLoader";

const Spinner = ({size}) => {
  const override = `
    position: relative;
    top: 0;
    bottom: 0;
    left:0;
    rigth:0;
  `;
  return(
    <>
      <ClimbingBoxLoader css={override} size={size}/>
    </>
  )
}

export default Spinner;
